import './App.css';

import React, { Component } from 'react'
import Navbar from './contaner/Navbar';
import News from './contaner/News';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

export class App extends Component {
  render() {
    return (
      <div>
<Router>

<Routes>

<Route path="/" element={<News sizeofpage={5} country="in" category='health'/>} />
<Route path="/business"><News sizeofpage={5} country="in" category='business' /></Route>
  <Route path="/entertainment"><News sizeofpage={5} country="in" category='entertainment' /></Route>
  <Route path="/general"><News sizeofpage={5} country="in" category='general' /></Route>
  <Route path="/health"><News sizeofpage={5} country="in" category='health' /></Route>
  <Route path="/science"><News sizeofpage={5} country="in" category='science' /></Route>
  <Route path="/sports"><News sizeofpage={5} country="in" category='sports' /></Route>
  <Route path="/technology"><News sizeofpage={5} country="in" category='technology' /></Route>

</Routes>

</Router>
      </div>
    )
  }
}

export default App
